import React from 'react';

const Navbar: React.FC = () => {
  return (
    <nav style={styles.nav}>
      <h1 style={styles.title}>SFlix</h1>
      <ul style={styles.navList}>
        <li style={styles.navItem}><a href="/" style={styles.navLink}>Anasayfa</a></li>
        <li style={styles.navItem}><a href="/about" style={styles.navLink}>Hakkımızda</a></li>
        <li style={styles.navItem}><a href="/contact" style={styles.navLink}>Diziler</a></li>
        <li style={styles.navItem}><a href="/contact" style={styles.navLink}>Fİlmler</a></li>
        <li style={styles.navItem}><a href="/contact" style={styles.navLink}>Kategoriler</a></li>
        <li style={styles.navItem}><a href="/contact" style={styles.navLink}>Profilim</a></li>
      </ul>
    </nav>
  );
};

const styles = {
  nav: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    backgroundColor: '#333',
    color: 'white',
    padding: '10px 20px',
  },
  title: {
    fontSize: '24px',
    margin: 0,
  },
  navList: {
    display: 'flex',
    listStyle: 'none',
    margin: 0,
    padding: 0,
  },
  navItem: {
    marginLeft: '20px',
  },
  navLink: {
    color: 'white',
    textDecoration: 'none',
  },
};

export default Navbar;
